import React from 'react';
import { Navbar, Nav, Form, FormControl, Button, ListGroup} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Navigation() {
return(
    
    <div className="Navigation">
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">ARCHIVE_SNS</Navbar.Brand>
    <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#user_contorl">user_contorl</Nav.Link>

        <ListGroup>
            <ListGroup.Item>login</ListGroup.Item>
            <ListGroup.Item>add</ListGroup.Item>
            <ListGroup.Item>user_List</ListGroup.Item>
        </ListGroup>

        
    </Nav>
    <Form inline>
        <FormControl type="text" placeholder="Please enter your content" className="mr-sm-2" />
        <Button variant="outline-info">Search</Button>
        <Nav.Link href="#user">user</Nav.Link>
    </Form>
</Navbar>
			
    </div>
);
}
    export default Navigation;
